import React, { useState } from "react";
import { Button, styled } from "reakit";

const Container = styled.div`
  margin: 8px;
  border: 1px solid lightgrey;
  border-radius: 2px;
`;

const Title = styled.h3`
  padding: 8px;
`;
const QuoteList = styled.div`
  padding: 8px;
`;
const Home = (props) => {
  return (
    <Container>
      <Title>{"Naslov"}</Title>
      <QuoteList>
        {props.data.map((data) => {
          <Quote key={data.id} quote={data}></Quote>;
        })}
      </QuoteList>
    </Container>
  );
};

export default Home;
